criteria.textblock:
        Inclusion Criteria:

          1. Chinese male or female adults aged ≥ 18 years;

          2. Healthy volunteers or volunteers with stable chronic diseases;

          3. Volunteers who provide signed written informed consent form.

        Exclusion Criteria:

          1. History of allergy to the investigational product, human immunoglobulin preparation or
             any component of other therapeutic monoclonal immunoglobulins;

          2. Any clinically significant chronic or acute medical condition that makes the volunteer
             unsuitable for participation;

          3. History of alcohol or other substance abuse.
